import React, {Component} from 'react';


class ReadContent extends Component {
	render(){
		console.log('ReadContent');
	  return(
			<article>
				writer: {this.props.writer}
				<h2>{this.props.title}</h2>
				{this.props.desc}
			</article>
	  );
	}
  }

  export default ReadContent;
